import React from 'react';
import Button from '@material-ui/core/Button';
import DeleteIcon from '@material-ui/icons/Delete';

export default function Buttons() {
    return (
        <div>
            <Button 
                endIcon={
                    <DeleteIcon />
                }
                color='primary'
                variant='outlined'
                component='a'
                href='https://www.excite.social'
            >
                Excite
            </Button>
            <Button 
                variant='contained'
                disabled 
            >
                Disabled
            </Button>
        </div>
    );
}
